/////////////////////////////////////////////////////////
// VERSION 3



pragma solidity ^0.8.0;

contract Ejercicio1CuentaAhorro {

    struct CuentaAhorro {
        int saldo; 
        string addressCuenta;
        string nombre;
        int edad;
        string colorFavorito;
    }

    // CuentaAhorro public c1 = CuentaAhorro(0,"Ivy", "0x5B38Da6a701c568545dCfcB03FcB875f56beddC4", 25 ,"Purpura");

    mapping (address => CuentaAhorro) public mappingCuentaAhorro;

    // function addCuentaAhorro (string nombre, int edad, string colorFavorito) public {
    //     mappingCuentaAhorro[msg.sender] = CuentaAhorro(0, nombre, msg.sender, edad, colorFavorito);
    // }

    // function addCuentaAhorro (string nombre) public return (string) {
    //     // mappingCuentaAhorro[msg.sender] = CuentaAhorro(0, nombre, msg.sender, edad, colorFavorito);
    //     return nombre;
    // }


    function ingresarSaldo (int saldoParaIngresar) public {
        require(saldoParaIngresar > 0, "saldo para ingresar debe ser mayor a 0");
        mappingCuentaAhorro[msg.sender].saldo += saldoParaIngresar;
    }

    function retirarSaldo (int saldoParaRetirar) public {
        require(saldoParaRetirar > 0, "saldo para retirar debe ser mayor a 0");
        require(mappingCuentaAhorro[msg.sender].saldo >= saldoParaRetirar , "saldo para retirar no debe ser mayor a su saldo actuarl");
        mappingCuentaAhorro[msg.sender].saldo -= saldoParaRetirar;
    }

    function addCuentaAhorro (string memory nombre) public {
        mappingCuentaAhorro[msg.sender].nombre = nombre;
    }
}

